function Navbar() {
  return (
    <nav className="navbar">
      <h1>AggieSwap</h1>
      <div className="links">
        <a href="/">Home</a>
        <a href="/swap">Swap</a>
        <a href="/wallet">Wallet</a>
      </div>
    </nav>
  );
}

export default Navbar;
